import React from "react";
import Lottie from "lottie-react";
import animationData from "./animations/logos.json";
import newAnimationData from "./animations/emoji.json"; // Импорт новой анимации

import "./Login.css";

const LoginAnimation = () => {
    return (
      <div className="animations-container">
        {/* Первая анимация */}
        <div className="animation-box first-animation">
          <Lottie animationData={animationData1} loop={true} autoplay={true} />
        </div>
  
        {/* Вторая анимация */}
        <div className="animation-box second-animation">
          <Lottie animationData={animationData2} loop={true} autoplay={true} />
        </div>
      </div>
    );
  };
  
  export default LoginAnimation;
